import styled from "styled-components";

const Wrapper = styled.section`
.containerStyle = {
  textAlign: "center",
  marginTop: "50px",
};

.headingStyle = {
  fontSize: "24px",
  marginBottom: "20px",
};

.linkStyle = {
  textDecoration: "none",
  color: "blue",
  fontSize: "16px",
};


`;

export default Wrapper;
